import React, {Component} from "react";

class Message extends Component {
    constructor() {
        super()
        this.state = {
            message: ', dude'
        }
    }

    render() {
        return (
            <h1>
                Welome {this.state.message}
            </h1>
        ) 
    }
}

export default Message
